import styled from "styled-components";
const Foot = styled.div`
  color: white;
  padding-left: 1rem;
  font-family: "Open Sans", sans-serif;
  font-weight: bold;
`;

const Footer = () => {
  return <Foot>2023 Exhi-lover published</Foot>;
};

export default Footer;
